import React from 'react';
import { Text } from 'react-native';
import { SafeAreaView } from 'react-native-safe-area-context';

function FeedScreen() {
  return (
    <SafeAreaView>
      <Text>Feed</Text>
    </SafeAreaView>
  );
}

export default FeedScreen;
